import re

def parse_dependencies(setup_content):
    dependencies = []
    dependency_links = []
    install_requires_match = re.search('', setup_content, re.DOTALL)
    if install_requires_match:
        dependencies = re.findall("'(.*?)'", install_requires_match.group(1))
    dependency_links_match = re.search('dependency_links=\\[(.*?)\\]', setup_content, re.DOTALL)
    if dependency_links_match:
        dependency_links = re.findall('"(.*?)"', dependency_links_match.group(1))
    return {'dependencies': dependencies, 'dependency_links': dependency_links}

